import React from "react";

import ThreeDots from "./components/UI/ThreeDots";
import Navbar from "./components/LeftBar/NavBarItems";
import Library from "./components/LeftBar/Library";

import './App.css'

const App = () => {
  return (
    <div>
      <div className="LeftBar">
      <ThreeDots />
      <Navbar />
      <Library/>
    </div>
    </div>
  );
};

export default App;
